import React, { Component } from "react";

class MovieDetail extends Component {
  render() {
    return (
      <>
        {this.props.movie ? (
          <h3 onClick={this.MovieClicked}>this.props.movie.title</h3>
        ) : null}
      </>
    );
  }
}
export default MovieDetail;
